    false,nt"url": null,nt"notes": "This map layer contains elevation data
    for Hawaii, in an Albers Equal-Area Conic projection. The elevation data were derived
    from National Elevation Dataset (NED) data, http://ned.usgs.gov, and show the terrain
    at a resolution of 100 meters. The NED is a raster product assembled by the U.S.
    Geological Survey, designed to provide national elevation data in a seamless form
    with a consistent datum, elevation unit, and projection. Data corrections made in
    the NED assembly process minimize artifacts, permit edge matching, and fill sliver
    areas of missing data. The NED is updated on a bi-monthly basis. This data set was
    derived from NED data released in December, 2010, http://ned.usgs.gov/downloads/documents/NED_Release_Notes_Dec10.pdf.",nt"license_title":
